        paddingVertical: 16,
        fontSize: 30
    },
    playerHeaderText: {
        color: 'red',
        fontSize: 16,
        textAlign: 'center'
    },
    basicCard: {
        padding: 6,
        borderRadius: 12,
        borderColor: 'white',
